  false,\n\t\"url\": null,\n\t\"notes\": \"In 2009, the state of Hawaii established
  the Kahekili Herbivore Fisheries Management Area (KHFMA) in West Maui. Fishing for
  herbivores (parrotfishes, surgeonfishes, chub, sea urchins) is prohibited within
  the KHFMA, as the goal is to use this form of marine management to prevent and possibly
  reverse shifts from coral to macroalgal domination, possibly evident on reefs at
  the KHFMA in recent years. nnThe NOAA Coral Reef Conservation Program (CRCP) has
  provided support for NOAA Coral Reef Ecosystem Program (NOAA CREP) staff to assist
  Hawaii Division of Aquatic Resources (HDAR) staff with maintaining long-term biological
  monitoring of the KHFMA, using methods implemented in pre-closure baseline surveys
  in 2008 by HDAR and their partners at that time. nnData are summary fish, benthic
  and urchin data from haphazardly located transects within the KHFMA. All transects
  are included.  Data can be accessed online via the NOAA National Centers for Environmental
  Information (NCEI) Ocean Archive, accession #0146683.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
